//

#include <iostream>
#include <vector>
// #include <unordered_map>
#include <map>

using namespace std;

class Solution{
public:
    vector<int> twoSum(vector<int>& numbers, int target) {

        vector<int> result;
        
        // solution 2 (keven, best, use two pointer)
        {
            int index_left = 0;
            int index_right = numbers.size() - 1;

            while(index_left < index_right){  // because the solution does NOT contain the same index, so = is NOT considerated
                if ( numbers[index_left] + numbers[index_right] == target )
                {
                    result.push_back(index_left+1);
                    result.push_back(index_right+1);
                    break;
                }
                else if ( numbers[index_left] + numbers[index_right] < target )
                {
                    index_left++;
                }
                else{
                    index_right--;
                }
                
            }
            return result;
        }
        
        // solution 1 (keven)
        {
            // unordered_map<int, int> current_num_index_unorderedmap;
            multimap<int, int> current_num_index_multimap;

            for (size_t i = 0; i < numbers.size(); i++)
            {
                current_num_index_multimap.insert(pair<int, int>(numbers[i], i));
            }
            
            int currentIndex = -1;
            int addIndex = -1;
            for (size_t i = 0; i < numbers.size(); i++)
            {
                auto currentNum_NeedAdd = target - numbers[i];
                int moveIndex = i + 1;

                // represent currentNum need add is NOT exist, so break it and search the next target number(save search time)!!
                if (current_num_index_multimap.count(currentNum_NeedAdd) == 0)
                {
                    continue;
                }
                
                for (auto check_ptr = current_num_index_multimap.begin(); check_ptr != current_num_index_multimap.end(); check_ptr++)
                {
                    // move to the element next to currentNum
                    while (moveIndex)
                    {
                        check_ptr++;
                        moveIndex--;
                    }

                    // start to check the element meet the target gap

                    // because current num is over the target gap, so break it(save search time)!!
                    if ( check_ptr->first > currentNum_NeedAdd )
                    {
                        break;
                    }
                    
                    if ( check_ptr->first == currentNum_NeedAdd )
                    {
                        // found it !!!!!
                        currentIndex = i;
                        addIndex = check_ptr->second;
                        printf("currentIndex:%d, addIndex:%d\n", currentIndex, addIndex);
                        break;
                    }
                    
                }
                
                if( addIndex != -1 )
                    break;

            }

            result.push_back(currentIndex + 1);
            result.push_back(addIndex + 1);
        }

        return result;
    }
};

